import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import './components/styles.css';
import Home from './components/Home';
import AdoptableDog from './components/Rescue/AdoptableDogs.jsx';

function App() {
  return (
    <Router>
    <div>
    <Switch>
      <Route path='/'>
       <Home/>
      <AdoptableDogPage/>

      </Route>
      <Route path="/adoptabledogs">
      <AdoptableDogPage/>
      </Route>
    </Switch>
    </div>
    </Router>
  );
}

export default App;

function AdoptableDogPage() {
  return (
    <div>
    <AdoptableDog/>
    <h1>hello</h1>
    </div>
    )
}
